import React from "react";

function Home() {
  return (
    <div id="home">
      <div className="titleContainer">
        <div className="title">HI</div>
        <div className="subtitle">I'm benjamin .</div>
      </div>

      <div class="curved-container">
        <img src="https://i.pinimg.com/1200x/a6/58/41/a65841ee82dfa2e1448193ac499358d1.jpg" alt="curved" />
        <svg class="wave" viewBox="0 0 1440 320" preserveAspectRatio="none">
          <path
            d="M0,288L48,272C96,256,192,224,288,213.3C384,203,480,213,576,240C672,267,768,309,864,304C960,299,1056,245,1152,229.3C1248,213,1344,235,1392,245.3L1440,256L1440,320L0,320Z"
            fill="#ffffff"
          />
        </svg>
      </div>
    </div>
  );
}

export default Home;
